class Solution:
    def longestDupSubstring(self, s: str) -> str:
        return self.suffix_array_long_dup_str(s)
        #return self.rolling_hash_long_dup_str(s)

    def suffix_array_long_dup_str(self, s: str) -> str:
        def suffix_array_radix_improve(string):
            string = string + '$'
            len_s = len(string)
            dist, k, c = 0, 0, [0] * len_s
            while dist < len_s:
                if k == 0:
                    arr = [ch for ch in string]
                    p = sorted(range(len_s), key=arr.__getitem__)
                    for i in range(1, len_s):
                        c[p[i]] = c[p[i-1]] + 1 if arr[p[i]] != arr[p[i-1]] else c[p[i-1]]
                else:
                    count, pos, p_new, c_new = [0] * len_s, [0] * len_s, [0] * len_s, [0] * len_s
                    for i in range(len_s):
                        count[c[i]] += 1
                    for i in range(1, len_s):
                        pos[i] = pos[i-1] + count[i-1]
                    for i in p:
                        new_i = (i-dist) % len_s
                        score = c[new_i]
                        p_new[pos[score]] = new_i
                        pos[score] += 1
                    p = p_new

                    for i in range(1, len_s):
                        cur = (c[p[i]], c[(p[i] + dist) % len_s])
                        prev = (c[p[i - 1]], c[(p[i - 1] + dist) % len_s])
                        c_new[p[i]] = c_new[p[i-1]] + 1 if cur != prev else c_new[p[i-1]]
                    c = c_new
                if c[p[i]] == len_s - 1:
                    break
                k += 1
                dist = 1 << (k - 1)
            return p[1:]

        def lcp(sa, s):
            len_s = len(s)
            lcp_sa, lcp_score = (0, 0), 0
            rank_t = [0] * len_s
            for rank, index in enumerate(sa):
                rank_t[index] = rank
            k = 1
            for cur in range(0, len_s):
                if rank_t[cur] == 0:
                    continue
                prev, k = sa[rank_t[cur] - 1], max(k - 1, 0)
                #print(prev, s[prev], cur, s[cur])
                while max(prev, cur) + k < len_s and s[prev + k] == s[cur + k]:
                    k += 1
                if k > lcp_score:
                    lcp_score = k
                    lcp_sa = (prev, cur)
            return lcp_sa, lcp_score

        sa = suffix_array_radix_improve(s)
        #print(s, sa)
        lcp_sa, lcp_score = lcp(sa, s)
        return s[lcp_sa[0]: lcp_sa[0] + lcp_score]

    def rolling_hash_long_dup_str(self, s: str) -> str:
        def find_same(seq, length, window_size, base, p):
            nonlocal s
            pos, rh, f_power = 0, 0, pow(base, window_size, p)
            while pos < window_size:
                rh = (rh * base + seq[pos]) % p
                pos += 1
            seen = collections.defaultdict(list)
            seen[rh].append(s[:pos])
            while pos < length:
                start = pos - window_size
                rh = ((rh * base - seq[start] * f_power ) % p + seq[pos]) % p
                start, pos = start + 1, pos + 1
                if rh in seen:
                    for sub_str in seen[rh]:
                        if s[start:pos] == sub_str:
                            return sub_str
                seen[rh].append(s[start:pos])
            return None

        len_s = len(s)
        ord_c = [ord(c) - 97 for c in s]
        left, right, longest_repeated, len_s = 1, len_s - 1, '', len(s)
        while left <= right:
            mid = left + (right - left) // 2
            sub_str = find_same(ord_c, len_s, mid, 26, 16573)
            if sub_str is not None:
                longest_repeated, left = sub_str, mid + 1
            else:
                right = mid - 1
        return longest_repeated


sol = Solution()
